// Projects.js
import React from 'react';

const Projects = () => {
  return (
    <main className="p-4">
      <h2 className="text-2xl text-center text-blue-800 font-bold">My Projects</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-4">
        {/* Project Card 1 */}
        <div className="bg-white rounded-lg shadow-md overflow-hidden">
          <img src="/Images/twincity.png" alt="Project Screenshot" className="w-full h-48 object-cover"/>
          <div className="p-4">
            <h3 className="text-lg text-blue-800">Twin Cities Weather and Tourism web application</h3>
            <p className="text-sm text-gray-700">A functioning application which displays a map of points of interest for tourists and a live weather forecast...</p>
            <a href="#" className="text-blue-600 hover:text-blue-800 transition-colors duration-300">View Live</a>
          </div>
        </div>
        {/* Additional project cards */}
      </div>
    </main>
  );
};

export default Projects;
